{"7": ["Полная ерунда. Сгорел через неделю, так и ни разу полностью не зарядив телефон. При этом прикуриватель так накалился, что ещё немного и загорелся бы. Очень был едкий запах пластмассы! ", "2018-10-04T08:41:56.815761413Z", "белый", "0", 1, 0, 1, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "16": ["просто дрянь. её цена должна быть как ценопаде все по 37 руб. перегрелась за 10 мин. использования. Итог: перестала заряжать. просто перевод денег. никому не советую.\n", "2018-06-05T15:36:18.063185047Z", "белый", "0", 2, 0, 1, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "17": ["Работает очень нестабильно. Часто перегревается и перестает заряжать.", "2018-05-10T08:36:24.555830943Z", "белый", "0", 1, 0, 3, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "18": ["Упаковка вскрыта и заклеена на кривой скотч, зарядник спокойно достается и засовывается обратно не нарушая \"упаковку\". Пришел в розовом цвете, хотя в описании нигде это не указывалось, планировался как подарок мужчине. Полный китай в худшем смысле этого слова", "2018-05-06T15:11:47.711700444Z", "белый", "0", 2, 0, 1, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "19": ["Упаковка вскрыта, даже проверять не стала на рабочее состояние.", "2018-04-18T19:34:57.231+03:00", "белый", "0", 2, 0, 1, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "20": ["Зарядка пришла в вскрытой коробке, даже скотчем неудосужились  заклеить, так еще и розовая, ладно бы черная, но розовая, артикул не тот. Заказывала мужу, отказ и очень неприятно, я понимаю, что товар копеечный, но нарушение целостности упаковки и в добавок неверное вложение! ", "2018-04-18T16:28:23.832+03:00", "белый", "0", 1, 0, 3, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"], "21": ["Вставили в прикуриватель и через 5-7 минут зарядка начала дымиться и пахнуть плавленной пластмассой . Выбросили ...", "2018-04-16T22:48:21.517+03:00", "белый", "0", 4, 0, 1, "Автомобильное зарядное устройство Pro Legend, 3 USB, 2А", "Pro Legend"]}
